    throws IOException {
  if (LOG.isDebugEnabled()) {
    LOG.debug("Removing master key " + masterKey.getKeyId());
  }

  String dbKey = getTokenMasterKeyDatabaseKey(masterKey);
  try {
    db.delete(bytes(dbKey));
  } catch (DBException e) {
    throw new IOException(e);
  }
